export default function About() {
    return (
        <div className='container mt-5'>
            <h1 className='text-center'>About Page</h1>
            <p>CRUD stands for Create, Read, Update, and Delete. In ReactJS everything is aligned in a form of a component and every component has its own way and feature to do so. React js is one of the most used JavaScript libraries for frontend development.</p>
        </div>
    )
}
